The sectet to flawless lashes is all in the application. The EASIEST way to get them looking natural is to get them close to your lash line. Just look down into your mirror at a 45¬∞ angle when applying.

And for maximum stickiness apply glue both above your lash line and to the lash strip. When you apply the lashes  it will have a velcro-esque effect with the glue on your skin and will bond crazy good!

