Cool Fact: the connecting passageways between the ears, nose & throat are smaller for kids than an adults! Makes sense now that we think about it, but it also means that there's a higher chance of bad bacteria settling within the passageways from various things our kiddos are exposed to! 

@blisprobioticsca Ears & Throat for Kids is a natural immune booster to help reduce the frequency of sore throats & ear infections caused by the bad bacteria! This easy to use formula can be administered orally, allowing the powder to dissolve on the tongue. If your kiddos won't take it that way, add it to their favourite snack or meal like yogurt! 

Blis Probiotics Ears & Throat for Kids can be found at a Rexall near you! Take advantage of their sale! 

@blisprobioticsca @rexalldrugstoreofficial @greenfresh.media #blisprobioticsca #increasethegood #oralprobiotic

